import React from "react";
import { Image, Typography } from "antd";
import Logo from "../../assets/Logo.png"
export default function AppHeader() {
    return (
        <div className="AppHeader">
            <Image
                width={40}
                src={Logo} alt={Logo}
            ></Image>
            <Typography.Title>Q&V Car Care</Typography.Title>
        </div>
    )
}
